	'generate_and_dispatch_event',
	'',
	"ba5eda7a-def5-0000-0000-000000000001",
	0,
	'if ( 1 == param.phase )               // setup

  create object instance a of A;
  a.odometer = 0;
  create object instance b of B;
  relate a to b across R1;
  
elif ( 2 == param.phase )             // run

  select any a from instances of A;
  generate A1:e() to a;

elif ( 3 == param.phase )             // unrun

  // Return false to avoid looping.
  return false;
  
elif ( 4 == param.phase )             // cleanup

  select any a from instances of A;
  generate A3:stop() to a;
  
elif ( 5 == param.phase )             // report

  select any a from instances of A;
  odometer_reading = a.odometer * param.count;
  ::report( message:"generate and dispatch event",
    count:odometer_reading,
