	'iterations = 10000;
if ( 1 == param.phase )               // setup

  create object instance e of E;
  create object instance f of F;
  create object instance g of G;
  
elif ( 2 == param.phase )             // run

  select any e from instances of E;
  select any f from instances of F;
  select any g from instances of G;
  i = iterations;
  while ( 0 < i )
    relate e to f across R3 using g;
    i = i - 1;
  end while;

elif ( 3 == param.phase )             // unrun

  select any e from instances of E;
  select one f related by e->F[R3];
  select one g related by e->G[R3];
  unrelate e from f across R3 using g;

elif ( 4 == param.phase )             // cleanup

  select any e from instances of E;
  delete object instance e;
  more = true;
  while ( more )
    select any f from instances of F;
    if ( not_empty f )
      delete object instance f;
    else
      more = false;
    end if;
  end while;
  more = true;
  while ( more )
    select any g from instances of G;
    if ( not_empty g )
      delete object instance g;
    else
      more = false;
    end if;
  end while;
  
elif ( 5 == param.phase )             // report

  i = iterations * param.count;
  ::report( message:"relate one to many using", count:i, duration:param.duration );

else
end if;

// Allow normal test looping.
return true;
