  more = true;
  while ( more )
    select any a from instances of A;
    if ( empty a )
      more = false;
    else
      delete object instance a;
    end if;
  end while;

elif ( 5 == param.phase )             // report

  i = iterations * param.count;
  ::report( message:"select many delete 5000 instances", count:i, duration:param.duration );

else
end if;

